import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as s from './ap'

ReactDOM.render(<>
	<ol>
	<li>{s.my}</li>
	<li>{s.name()}</li>
	<li>{s.names()}</li>
	</ol>
	</>,document.getElementById("root"));
